    [],nt"revision_timestamp": "2016-07-27T22:43:30.547921",nt"name": "1991-progress-report-and-1989-1991-preliminary-final-report-fergus-falls-alexandria-experi",nt"isopen":
    false,nt"url": null,nt"notes": "The number of resident Canada geese in
    the Fergus Falls/Alexandria vicinity has increased to a level that has created nuisance
    problems. The growth of this flock has accelerated in recent years despite additional
    pressure resulting from opening two major goose refuges to hunting during the regular
    season. This report describes preliminary results of a three year experiment to
    evaluate the effectiveness of an additional annual 10-day September hunting season.
    This summary of the 3-year September Canada goose hunt in the Fergus Falls/Alexandria
    zone contains additional detail on the 1991 season. Comparable details on the 1989
    and 1990 seasons are available in the earlier progress reports.",nt"license_title":
